import { useSelector } from "react-redux";

function Body({tableList}){
    // const tableList = useSelector()
    return <tbody>
        {tableList.length > 0
        && tableList.map(row => <tr key={row.id}>
            <td>{row.name}</td>
            <td>{row.age}</td>
        </tr>)}
    </tbody>
}

export default Body;
